Que vôtre ame les forme, & qu'il n’eſt en ces lieux;
Fâcheux que par vos ſoins, jaloux que par vos yeux.
Encor un coup, Dom Lope, une ame bien épriſe
Des ſoupçons qu'elle prend, ne me rend point ſurpriſe;
Mais qu'on ait ſans amour tous les ſoins d'un jaloux,
C’eſt une nouveauté qui n’appartient qu’à vous.
